import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  Typography,
  Box,
  Button,
  LinearProgress,
  Avatar,
  Chip,
  Alert,
  Fade,
  CircularProgress,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions
} from '@mui/material';
import {
  Psychology,
  TrendingUp,
  Groups,
  LocalFireDepartment,
  Mood,
  Close,
  PlayArrow,
  CheckCircle,
  Warning
} from '@mui/icons-material';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';
import { useEmotion } from '../context/EmotionContext';

const Dashboard = ({ user }) => {
  const {
    currentMood,
    moodHistory,
    wellnessStreak,
    interventions,
    analyzeMood,
    generateInsights,
    isAnalyzing
  } = useEmotion();

  const [selectedIntervention, setSelectedIntervention] = useState(null);
  const [insights, setInsights] = useState(null);
  const [quickMoodCheck, setQuickMoodCheck] = useState('');

  useEffect(() => {
    // Generate insights on component mount
    const insightData = generateInsights();
    setInsights(insightData);
  }, [generateInsights]);

  const handleMoodAnalysis = async () => {
    if (quickMoodCheck.trim()) {
      await analyzeMood(quickMoodCheck);
      setQuickMoodCheck('');
    }
  };

  const handleInterventionStart = (intervention) => {
    setSelectedIntervention(intervention);
  };

  const handleInterventionComplete = () => {
    // Mark intervention as completed
    setSelectedIntervention(null);
    // Update wellness streak logic could go here
  };

  const getMoodColor = (mood) => {
    const colors = {
      positive: '#4caf50',
      neutral: '#ff9800',
      negative: '#f44336',
      stressed: '#e91e63'
    };
    return colors[mood] || '#9e9e9e';
  };

  const getMoodEmoji = (mood) => {
    const emojis = {
      positive: 'ðŸ˜Š',
      neutral: 'ðŸ˜',
      negative: 'ðŸ˜ž',
      stressed: 'ðŸ˜°'
    };
    return emojis[mood] || 'ðŸ¤”';
  };

  // Prepare mood history data for chart
  const chartData = moodHistory.slice(-14).map((entry, index) => ({
    day: `Day ${index + 1}`,
    score: entry.mood === 'positive' ? 2 : entry.mood === 'neutral' ? 1 : entry.mood === 'negative' ? -1 : -2,
    mood: entry.mood
  }));

  // Mood distribution for pie chart
  const moodDistribution = Object.entries(
    moodHistory.reduce((acc, entry) => {
      acc[entry.mood] = (acc[entry.mood] || 0) + 1;
      return acc;
    }, {})
  ).map(([mood, count]) => ({
    name: mood,
    value: count,
    color: getMoodColor(mood)
  }));

  const COLORS = ['#4caf50', '#ff9800', '#f44336', '#e91e63'];

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Fade in={true} timeout={1000}>
        <Box>
          {/* Welcome Header */}
          <Box sx={{ mb: 4 }}>
            <Typography variant="h4" fontWeight="bold" gutterBottom>
              Welcome back, {user.name}! ðŸ‘‹
            </Typography>
            <Typography variant="body1" color="text.secondary">
              Track your mental wellness journey and connect with your campus community
            </Typography>
          </Box>

          <Grid container spacing={3}>
            {/* Current Mood Card */}
            <Grid item xs={12} md={6} lg={3}>
              <Card sx={{ height: '100%', position: 'relative', overflow: 'visible' }}>
                <CardContent sx={{ textAlign: 'center', py: 3 }}>
                  <Box sx={{ 
                    fontSize: '4rem', 
                    mb: 1,
                    filter: 'drop-shadow(0 4px 8px rgba(0,0,0,0.3))'
                  }}>
                    {getMoodEmoji(currentMood)}
                  </Box>
                  <Typography variant="h6" fontWeight="600" sx={{ textTransform: 'capitalize' }}>
                    {currentMood || 'Unknown'}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Current Mood
                  </Typography>
                  <Box sx={{ mt: 2 }}>
                    <LinearProgress
                      variant="determinate"
                      value={currentMood === 'positive' ? 100 : currentMood === 'neutral' ? 60 : 30}
                      sx={{
                        height: 8,
                        borderRadius: 4,
                        backgroundColor: 'rgba(255,255,255,0.1)',
                        '& .MuiLinearProgress-bar': {
                          backgroundColor: getMoodColor(currentMood),
                          borderRadius: 4
                        }
                      }}
                    />
                  </Box>
                </CardContent>
              </Card>
            </Grid>

            {/* Wellness Streak Card */}
            <Grid item xs={12} md={6} lg={3}>
              <Card sx={{ height: '100%' }}>
                <CardContent sx={{ textAlign: 'center', py: 3 }}>
                  <LocalFireDepartment sx={{ fontSize: '3rem', color: '#ff6b35', mb: 1 }} />
                  <Typography variant="h4" fontWeight="bold" color="#ff6b35">
                    {wellnessStreak}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Day Wellness Streak
                  </Typography>
                  <Typography variant="caption" color="text.secondary" sx={{ display: 'block', mt: 1 }}>
                    Keep up the great work! ðŸ”¥
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            {/* Mood Insights Card */}
            <Grid item xs={12} md={6} lg={3}>
              <Card sx={{ height: '100%' }}>
                <CardContent sx={{ textAlign: 'center', py: 3 }}>
                  <TrendingUp sx={{ fontSize: '3rem', color: '#4caf50', mb: 1 }} />
                  <Typography variant="h6" fontWeight="600">
                    {insights?.patterns?.positive > insights?.patterns?.negative ? 'Improving' : 'Needs Attention'}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Overall Trend
                  </Typography>
                  <Typography variant="caption" color="text.secondary" sx={{ display: 'block', mt: 1 }}>
                    Based on recent patterns
                  </Typography>
                </CardContent>
              </Card>
            </Grid>

            {/* Support Network Card */}
            <Grid item xs={12} md={6} lg={3}>
              <Card sx={{ height: '100%' }}>
                <CardContent sx={{ textAlign: 'center', py: 3 }}>
                  <Groups sx={{ fontSize: '3rem', color: '#764ba2', mb: 1 }} />
                  <Typography variant="h6" fontWeight="600">
                    12 Active
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Support Connections
                  </Typography>
                  <Button variant="outlined" size="small" sx={{ mt: 1 }}>
                    Connect More
                  </Button>
                </CardContent>
              </Card>
            </Grid>

            {/* Quick Mood Check */}
            <Grid item xs={12} md={6}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center' }}>
                    <Psychology sx={{ mr: 1 }} />
                    Quick Mood Check
                  </Typography>
                  <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                    How are you feeling right now? Share your thoughts...
                  </Typography>
                  <Box sx={{ display: 'flex', gap: 1 }}>
                    <input
                      type="text"
                      value={quickMoodCheck}
                      onChange={(e) => setQuickMoodCheck(e.target.value)}
                      placeholder="I'm feeling..."
                      style={{
                        flex: 1,
                        padding: '12px',
                        borderRadius: '8px',
                        border: '1px solid rgba(255,255,255,0.3)',
                        background: 'rgba(255,255,255,0.05)',
                        color: 'white',
                        fontSize: '14px'
                      }}
                      onKeyPress={(e) => e.key === 'Enter' && handleMoodAnalysis()}
                    />
                    <Button
                      variant="contained"
                      onClick={handleMoodAnalysis}
                      disabled={isAnalyzing || !quickMoodCheck.trim()}
                      sx={{ minWidth: 100 }}
                    >
                      {isAnalyzing ? <CircularProgress size={20} /> : 'Analyze'}
                    </Button>
                  </Box>
                </CardContent>
              </Card>
            </Grid>

            {/* Recent Interventions */}
            <Grid item xs={12} md={6}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center' }}>
                    <Mood sx={{ mr: 1 }} />
                    Recent Interventions
                  </Typography>
                  <Box sx={{ maxHeight: 200, overflowY: 'auto' }}>
                    {interventions.length > 0 ? (
                      interventions.slice(0, 3).map((intervention, index) => (
                        <Box
                          key={intervention.id}
                          sx={{
                            p: 2,
                            mb: 1,
                            borderRadius: 2,
                            background: 'rgba(255,255,255,0.05)',
                            border: '1px solid rgba(255,255,255,0.1)',
                            cursor: 'pointer',
                            '&:hover': { background: 'rgba(255,255,255,0.1)' }
                          }}
                          onClick={() => handleInterventionStart(intervention)}
                        >
                          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                            <Box>
                              <Typography variant="subtitle2" fontWeight="600">
                                {intervention.icon} {intervention.title}
                              </Typography>
                              <Typography variant="caption" color="text.secondary">
                                {intervention.duration} â€¢ {new Date(intervention.timestamp).toLocaleTimeString()}
                              </Typography>
                            </Box>
                            <IconButton size="small" color="primary">
                              <PlayArrow />
                            </IconButton>
                          </Box>
                        </Box>
                      ))
                    ) : (
                      <Typography variant="body2" color="text.secondary" sx={{ textAlign: 'center', py: 2 }}>
                        No recent interventions. Keep monitoring your mood!
                      </Typography>
                    )}
                  </Box>
                </CardContent>
              </Card>
            </Grid>

            {/* Mood Trend Chart */}
            <Grid item xs={12} md={8}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    14-Day Mood Trend
                  </Typography>
                  <Box sx={{ height: 300, mt: 2 }}>
                    {chartData.length > 0 ? (
                      <ResponsiveContainer width="100%" height="100%">
                        <LineChart data={chartData}>
                          <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
                          <XAxis dataKey="day" stroke="rgba(255,255,255,0.7)" />
                          <YAxis domain={[-2, 2]} stroke="rgba(255,255,255,0.7)" />
                          <Tooltip
                            contentStyle={{
                              backgroundColor: 'rgba(26,29,41,0.95)',
                              border: '1px solid rgba(255,255,255,0.1)',
                              borderRadius: '8px'
                            }}
                          />
                          <Line
                            type="monotone"
                            dataKey="score"
                            stroke="#667eea"
                            strokeWidth={3}
                            dot={{ fill: '#667eea', strokeWidth: 2, r: 6 }}
                            activeDot={{ r: 8, stroke: '#667eea', strokeWidth: 2 }}
                          />
                        </LineChart>
                      </ResponsiveContainer>
                    ) : (
                      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100%' }}>
                        <Typography variant="body2" color="text.secondary">
                          Start tracking your mood to see trends here
                        </Typography>
                      </Box>
                    )}
                  </Box>
                </CardContent>
              </Card>
            </Grid>

            {/* Mood Distribution */}
            <Grid item xs={12} md={4}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    Mood Distribution
                  </Typography>
                  <Box sx={{ height: 250, mt: 2 }}>
                    {moodDistribution.length > 0 ? (
                      <ResponsiveContainer width="100%" height="100%">
                        <PieChart>
                          <Pie
                            data={moodDistribution}
                            cx="50%"
                            cy="50%"
                            outerRadius={80}
                            fill="#8884d8"
                            dataKey="value"
                            label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
                          >
                            {moodDistribution.map((entry, index) => (
                              <Cell key={`cell-${index}`} fill={entry.color} />
                            ))}
                          </Pie>
                          <Tooltip />
                        </PieChart>
                      </ResponsiveContainer>
                    ) : (
                      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100%' }}>
                        <Typography variant="body2" color="text.secondary">
                          No mood data available yet
                        </Typography>
                      </Box>
                    )}
                  </Box>
                </CardContent>
              </Card>
            </Grid>

            {/* Personalized Recommendations */}
            <Grid item xs={12}>
              <Card>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    Personalized Recommendations
                  </Typography>
                  <Grid container spacing={2}>
                    {insights?.recommendations?.length > 0 ? (
                      insights.recommendations.map((rec, index) => (
                        <Grid item xs={12} md={4} key={index}>
                          <Alert
                            severity="info"
                            icon={<Psychology />}
                            sx={{
                              background: 'rgba(102,126,234,0.1)',
                              border: '1px solid rgba(102,126,234,0.3)',
                              '& .MuiAlert-icon': { color: '#667eea' }
                            }}
                          >
                            {rec}
                          </Alert>
                        </Grid>
                      ))
                    ) : (
                      <Grid item xs={12}>
                        <Alert severity="info">
                          Keep tracking your mood to get personalized recommendations!
                        </Alert>
                      </Grid>
                    )}
                  </Grid>
                </CardContent>
              </Card>
            </Grid>
          </Grid>

          {/* Intervention Dialog */}
          <Dialog
            open={Boolean(selectedIntervention)}
            onClose={() => setSelectedIntervention(null)}
            maxWidth="sm"
            fullWidth
            PaperProps={{
              sx: {
                background: 'rgba(26,29,41,0.95)',
                backdropFilter: 'blur(20px)',
                border: '1px solid rgba(255,255,255,0.1)'
              }
            }}
          >
            {selectedIntervention && (
              <>
                <DialogTitle sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                  <Box sx={{ display: 'flex', alignItems: 'center' }}>
                    <Typography variant="h5" sx={{ mr: 1 }}>
                      {selectedIntervention.icon}
                    </Typography>
                    <Typography variant="h6">
                      {selectedIntervention.title}
                    </Typography>
                  </Box>
                  <IconButton onClick={() => setSelectedIntervention(null)}>
                    <Close />
                  </IconButton>
                </DialogTitle>
                <DialogContent>
                  <Typography variant="body1" sx={{ mb: 2 }}>
                    {selectedIntervention.description}
                  </Typography>
                  <Chip
                    label={`Duration: ${selectedIntervention.duration}`}
                    variant="outlined"
                    sx={{ mb: 2 }}
                  />
                  <Box sx={{
                    p: 3,
                    borderRadius: 2,
                    background: 'rgba(102,126,234,0.1)',
                    border: '1px solid rgba(102,126,234,0.3)',
                    textAlign: 'center'
                  }}>
                    <Typography variant="h6" gutterBottom>
                      Ready to start your wellness moment?
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Take a few minutes for yourself. You deserve this break.
                    </Typography>
                  </Box>
                </DialogContent>
                <DialogActions sx={{ p: 3 }}>
                  <Button onClick={() => setSelectedIntervention(null)}>
                    Maybe Later
                  </Button>
                  <Button
                    variant="contained"
                    onClick={handleInterventionComplete}
                    startIcon={<CheckCircle />}
                    sx={{ ml: 1 }}
                  >
                    Start Activity
                  </Button>
                </DialogActions>
              </>
            )}
          </Dialog>
        </Box>
      </Fade>
    </Container>
  );
};

export default Dashboard;
